import 'Places.dart';


class AllGovPlacesResponse {
  AllGovPlacesResponse({
      this.name, 
      this.photo, 
      this.places,});

  AllGovPlacesResponse.fromJson(dynamic json) {
    name = json['name'];
    photo = json['photo'];
    if (json['places'] != null) {
      places = [];
      json['places'].forEach((v) {
        places?.add(Places.fromJson(v));
      });
    }
  }
  String? name;
  String? photo;
  List<Places>? places;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['name'] = name;
    map['photo'] = photo;
    if (places != null) {
      map['places'] = places?.map((v) => v.toJson()).toList();
    }
    return map;
  }

}

